import React from "react";

function Header() {
    return (
        <header>
            <img src="https://www.stickpng.com/assets/thumbs/5845e69dfb0b0755fa99d7ef.png" 
            alt="missing?"/>

            <h1>Meme Template Generator xddd</h1>
            <h3>Find templates for making terribly unfunny memes!</h3>
            <h3>Click the "gen" button for a different template lol</h3>
        </header>
    )
}

export default Header;
